import React, { Suspense, lazy } from 'react';
import { Switch, Route } from 'react-router-dom';
import Login from '../containers/Login';
import PrivateRoute from './PrivateRoute';
// import Dashboard from '../containers/Dashboard';
import HighOrderLayout from '../containers/HighOrderLayout';
import Tracking from '../containers/Tracking';
import Reports from '../containers/Reports';
import Configurations from '../containers/Configurations';

const Dashboard = lazy(() => import('../containers/Dashboard'));

function Routers() {
  return (
    <Switch>
      <Suspense fallback={'loading'}>
        <Route path='/login' component={Login} />
        <PrivateRoute exact path='/' component={HighOrderLayout(Dashboard)} />
        <PrivateRoute
          exact
          path='/operations'
          component={HighOrderLayout(Dashboard)}
        />
        <PrivateRoute
          exact
          path='/tracking'
          component={HighOrderLayout(Tracking)}
        />
        <PrivateRoute
          exact
          path='/reports'
          component={HighOrderLayout(Reports)}
        />
        <PrivateRoute
          exact
          path='/configurations'
          component={HighOrderLayout(Configurations)}
        />
      </Suspense>
    </Switch>
  );
}

export default Routers;
